create table tmp_action_link
(
    id               uuid,
    parent_action_id uuid,
    child_action_id  uuid,
    title            text,
    is_action_target boolean,
    via_parameters   boolean,
    "order"          integer,
    mounted_to_row   boolean,
    category         varchar,
    variable         varchar,
    mapping          varchar
);

alter table tmp_action_link
    owner to postgres;

